import React, {Component} from 'react';


class Box extends Component{
    render() {
        let tag = ''
        const boxData = this.props.boxData;
        const tagBox = (boxData).map((data) => {
            return(
                tag = (data.tag).map(tag =>
                    <a href={data.href}>{tag}</a>
                )

            )
        })
        return(
            <div className="fe-base-box clearfix">
                <div className="banner-line">
                    <span className="bold mr10 l small-title">{}</span>
                </div>
                <div className="tag-box l">
                    {tagBox.tag}
                </div>
            </div>
        );
    }
}
export default Box
